h("text!polish/transitions.css",[],function(){return"/*\n * Toolbar visibility transitions. Props to http://www.greywyvern.com/?post=337 for the idea.\n *\n */\n\n /* Ego toolbar fade. Long term we should probably use a transitionEnd event to set display:none but that's not reliable yet. */\n.ephox-polish-editor-container .ephox-polish-draggable-container,\n.ephox-polish-editor-container.ephox-polish-fade-container {\n  /*\n   * NOTE: The visibility transition must have a delay equal to the opacity transition.\n   * This has the effect of only hiding the toolbar after it's invisible.\n   */\n  transition: visibility 0s linear 0.3s, opacity 0.3s ease;\n  visibility: hidden;\n  opacity: 0;\n}\n\n.ephox-polish-editor-container .ephox-polish-drag-show {\n  visibility: visible;\n  opacity: 1;\n\n  /*\n   * Set all transition delays to 0s, overriding visibility to apply immediately\n   * and thus allowing the opacity to fade in\n   */\n  transition-delay: 0s;\n}\n\n\n/*\n * Hiding and showing the more drawer\n *\n * Due to the dynamic nature of the sliding toolbar (height can change, even when open) the values must be set via JS.\n *\n * It works a little bit like this: http://jsfiddle.net/adambiggs/MAbD3/\n */\n.ephox-polish-editor-container .ephox-chameleon-toolbar-more-closed {\n  visibility: hidden;\n  opacity: 0;\n}\n\n.ephox-polish-editor-container .ephox-chameleon-toolbar-more-open {\n  visibility: visible;\n  opacity: 1;\n}\n\n.ephox-polish-editor-container .ephox-chameleon-toolbar-more-show {\n  /*\n   * Transition the height for 0.3s\n   * After 0.1s, transition opacity for 0.2s\n   * No visibility transition, it needs to show immediately\n   */\n  transition: height 0.3s ease, opacity 0.2s linear 0.1s;\n}\n\n.ephox-polish-editor-container .ephox-chameleon-toolbar-more-hide {\n  /*\n   * Transition the opacity for 0.3s\n   * After 0.1s, transition height for 0.2s\n   * After 0.3s, transition visibility for 0s\n   */\n  transition: opacity 0.3s ease, height 0.2s linear 0.1s, visibility 0s linear 0.3s;\n}\n\n\n\n/*\n * Snippet sidebar hide/show\n */\n.ephox-polish-editor-container .ephox-whip-sidebar-hide {\n  visibility: hidden;\n  opacity: 0;\n  /* Delay visibility change by 0.3s */\n  transition: width 0.3s ease, opacity 0.3s ease, visibility 0s linear 0.3s;\n}\n\n.ephox-polish-editor-container .ephox-whip-sidebar-show {\n  visibility: visible;\n  opacity: 1;\n  /* Instant visibility change */\n  transition: width 0.3s ease, opacity 0.3s ease, visibility 0s linear 0s;\n}\n\n.ephox-polish-editor-container .ephox-whip-content {\n  transition: width 0.3s ease;\n}\n\n\n/*\n * desktop menu open animations\n */\n\n.ephox-chameleon-layer-menus {\n  transition: opacity 0.09s linear;\n}\n\n/*\n * Mobile menu open animations\n */\n.ephox-polish-mobile-layout .ephox-chameleon-layer-menus {\n  transition: opacity 0.15s linear\n}\n\n.ephox-chameleon-toolstrip.ephox-polish-mobile-show {\n  transition: top 0.2s linear;\n}\n\n/*\n * Card menu slide transitions\n */\n\n.ephox-chameleon-left-animate {\n  transition: left 0.2s ease;\n}\n\n.ephox-chameleon-height-animate {\n  transition: height 0.2s ease;\n}\n\n"});
